import { useState, useEffect } from "react";

const Clima = ({ region }) => {
  const [dataResponse, setDataResponse] = useState("");
  console.log(region);
  const apiKey = process.env.REACT_APP_API_KEY;
  const apiUrl = `https://api.openweathermap.org/data/2.5/weather?${region}&appid=${apiKey}`;

  useEffect(() => {
    fetch(apiUrl)
      .then((response) => response.json())
      .then((data) => {
        const obj = {
          weather: data[1].description,
        };
        setDataResponse([...dataResponse, obj]);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [region]);
  console.log(dataResponse);

  return <div>Hola</div>;
};

export default Clima;
